import React from 'react';
import { NavTab } from '../NavTab/NavTab';
import './Description.css';
import weblogo from '../../images/logo-web.svg';

export const Promo = () => {
  return (
    <section className="description">
      <img className="description__logo" alt="web-logo" src={weblogo}></img>
      <div className="description__block">
      <h1 className="description__title">Учебный проект студента факультета Веб&#8209;разработки.</h1>
      <p className="description__paragraph">Листайте ниже, чтобы узнать больше про этот проект и его создателя</p>
      </div>
      <NavTab />
    </section>
  );
}
